import * as React from 'react';
import { useTheme } from '@mui/material/styles';
import { LineChart, AreaChart, Line, XAxis, YAxis, Label, ResponsiveContainer } from 'recharts';
import Title from './Title';

function createData(time, max, min) {
    return { time, max, min };
  }
  
  const data = [
    createData('00:00', 26.5, 23.0),
    createData('03:00', 25.7, 24.0),
    createData('06:00', 23.0, 22.0),
    createData('09:00', 26.5, 24.7),
    createData('12:00', 24.0, 21.3),
    createData('15:00', 25.0, 22.),
    createData('18:00', 25.6, 2400),
    createData('21:00', 26.5, 2400),
    createData('24:00', undefined),
  ];
  
  export default function Chart() {
    const theme = useTheme();
  
    return (
      <React.Fragment>
        <Title>Today</Title>
        <ResponsiveContainer>
          <AreaChart
            data={data}
            margin={{
              top: 16,
              right: 16,
              bottom: 0,
              left: 24,
            }}
          >
            <XAxis
              dataKey="time"
              stroke={theme.palette.text.secondary}
              style={theme.typography.body2}
            />
            <YAxis
              stroke={theme.palette.text.secondary}
              style={theme.typography.body2}
            >
              <Label
                angle={270}
                position="left"
                style={{
                  textAnchor: 'middle',
                  fill: theme.palette.text.primary,
                  ...theme.typography.body1,
                }}
              >
                Temperature

              </Label>
            </YAxis>
            <Line
              isAnimationActive={false}
              type="monotone"
              dataKey="amount"
              stroke={theme.palette.primary.main}
              dot={false}
            />
          </AreaChart>
        </ResponsiveContainer>
      </React.Fragment>
    );
  }
